		"lyrics": {
			"verse": [
				{
					"lines": [
						"Puissance, honneur et gloire,",
						"À l’Agneau de Dieu !"
					],
					"_name": "c1"
				},
				{
					"lines": [
						"Tu es digne, Seigneur, notre Dieu,",
						"De recevoir l’honneur, la gloire et la puissance,",
						"C’est toi qui créas l’univers,",
						"C’est par ta volonté",
						"Qu’il reçût l’existence et fut créé."
					],
					"_name": "v1"
				},
				{
					"lines": [
						"Tu es digne, Seigneur, de recevoir le livre,",
						"Et d’en ouvrir les pages scellées,",
						"Car tu fus immolé",
						"Nous rachetant pour Dieu, par ton sang,",
						"De toutes tribus, langues et peuples et nations."
					],
					"_name": "v2"
				},
				{
					"lines": [
						"Tu as fait de nous pour notre Dieu un royaume de prêtres,",
						"Et nous régnerons sur la terre.",
						"Il est digne l’Agneau immolé,",
						"De recevoir puissance et richesse, sagesse et force,",
						"Honneur, gloire et louange."
					],
					"_name": "v3"
				},
				{
					"lines": [
						"Rendons gloire au Père tout-puissant,",
						"À son Fils, Jésus Christ, le Seigneur,",
						"À l’Esprit qui habite en nos cœurs",
						"Pour les siècles des siècles. Amen."
					],
					"_name": "v4"
				}
			]
		},
