		"lyrics": {
			"verse": [
				{
					"lines": [
						"La vie éternelle, c’est de te connaître Père,",
						"Et c’est de connaître celui que tu envoies.",
						"Tu nous as rachetés par lui, dans ton amour,",
						"Et nous croyons que Jésus est Seigneur."
					],
					"_name": "c1"
				},
				{
					"lines": [
						"Ton Fils bien-aimé t’a glorifié,",
						"Et tu as glorifié ton Fils.",
						"Nous avons la vie éternelle",
						"En Jésus, notre Rédempteur."
					],
					"_name": "v1"
				},
				{
					"lines": [
						"À tous ceux que tu lui as donnés,",
						"Jésus a révélé ton nom.",
						"Et ils ont gardé sa parole,",
						"Reconnu en lui le Messie."
					],
					"_name": "v2"
				},
				{
					"lines": [
						"Béni soit le nom de Jésus Christ,",
						"Béni soit l’envoyé de Dieu.",
						"Glorifié, assis près du Père,",
						"Il nous garde en un seul amour."
					],
					"_name": "v3"
				},
				{
					"lines": [
						"Père Saint, protège-nous du mal ;",
						"Ta parole est la vérité.",
						"Nous vivons au cœur de ce monde,",
						"Garde-nous dans la sainteté."
					],
					"_name": "v4"
				},
				{
					"lines": [
						"Père Saint, tu demeures en ton fils,",
						"Toi en lui, comme lui en toi.",
						"Nous voici comblés de ta gloire,",
						"Conduis-nous dans la vérité."
					],
					"_name": "v5"
				},
				{
					"lines": [
						"Père Saint, tu as aimé ton Fils,",
						"Et ton Fils nous a tant aimés.",
						"Notre monde attend de renaître,",
						"Rends-nous forts dans la charité."
					],
					"_name": "v6"
				}
			]
		},
